CREATE TABLE `customers` (`customer_id` int AUTO_INCREMENT, `joined_at` timestamp NULL DEFAULT NULL, `last_login_at` timestamp NULL DEFAULT NULL, `state` varchar(100) DEFAULT NULL, `is_deactivated` tinyint(1) DEFAULT NULL, `name` varchar(100) DEFAULT NULL, `email` varchar(100) DEFAULT NULL, PRIMARY KEY (`customer_id`));


CREATE TABLE `products` (`product_id` int AUTO_INCREMENT, `added_at` timestamp NULL DEFAULT NULL, `product_cost` decimal(15,2) DEFAULT NULL, `product_name` varchar(50) DEFAULT NULL, `product_category` varchar(50) DEFAULT NULL, PRIMARY KEY (`product_id`));


CREATE TABLE `transactions` (`transact_id` int AUTO_INCREMENT, `customer_id` int(11) DEFAULT NULL, `transact_at` timestamp NULL DEFAULT NULL, `transact_amt` decimal(15,2) DEFAULT NULL, `product_id` int(11) DEFAULT NULL, `payment_type` varchar(100) NULL, `payment_success` tinyint(1) DEFAULT NULL, PRIMARY KEY (`transact_id`));

